import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";
import Footer from "./components/Footer/Footer";
import Header from "./components/Header/Header";

function App() {
  return (
    <div className="container-fluid">
      <div className="row">
        <Header />
      </div>

      <div className="row">
        <Footer />
      </div>
    </div>
  );
}

export default App;
